pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "./PizzaSupreme.sol";

contract PizzaOven is Ownable {
    using Strings for string;
    using SafeMath for uint256;

    address public nftAddress;
    uint256 public MAX_SUPPLY;
    uint256 public mintPrice;


    constructor(address _nftAddress) {
        MAX_SUPPLY = 8888;
        mintPrice = 88800000000000000; // 0.0888 ETH
        nftAddress = _nftAddress;
    }

    function name() external pure returns (string memory) {
        return "PizzaSupreme Oven";
    }

    function symbol() external pure returns (string memory) {
        return "PSO";
    }

    function mint(uint256 amount, address _toAddress) external payable {
        require(mintPrice.mul(amount) <= msg.value, "Ether value sent is not correct");


        PizzaSupreme pizzaSupreme = PizzaSupreme(nftAddress);
        uint256 currentSupply = pizzaSupreme.totalSupply();
        require(currentSupply + amount <= MAX_SUPPLY, "Purchase would exceed max supply");

        for (uint256 i = 0; i < amount; i++) {
            pizzaSupreme.factoryMint(_toAddress);
        }
    }

    function withdraw() external onlyOwner {
        uint256 balance = address(this).balance;
        payable(owner()).transfer(balance);
    }
}
